import React from "react";

function Employees(props) {
  return (
    <div>
      <table>
        <tr>
          <th scope="row">Picture</th>
          <th>First Name</th>
          <th>Last Name</th>
          <th>Phone #</th>
          <th>ID #</th>
        </tr>
        {props.employeeList.map((employee) => {
          return (
            <tr>
              <img src={employee.picture.medium} img alt={employee.name.first + employee.name.last} className="img-fluid" />
              <td className="align-middle">{employee.name.first}</td>
              <td className="align-middle">{employee.name.last}</td>
              <td className="align-middle">{employee.phone}</td>
              <td>{employee.id.value}</td>
            </tr>
          );
        })}
      </table>
    </div>
  );
}

function Employee(props) {
  return (
      <tr>
          <th scope="row">
              <img alt={props.name} className="img-fluid" src={props.image} />
          </th>
          <td className="align-middle">{props.name}</td>
          <td className="align-middle">{props.phone}</td>
          <td className="align-middle">
              <a href={`mailto:${props.email}`}>
                  {props.email}
              </a>   
          </td>
          <td className="align-middle">{props.dob}</td>
      </tr>
  )
}


